import './card.style.css';

export const Card = props => (
        <div className="card-container">
            <img src={'https://robohash.org/${props.monster.id}?set=set2&size=150x150'} alt="monster"/>
            <h1> {props.monster.name} </h1>
            <p> {props.monster.email} </p>
        </div>
    );
